import React from "react";

const Cart = ({ cart }) => {
    return (
        <>
            {cart.map((e, index) =>
                <div className="container-fluid" key={e._id}>
                    <div className="row">
                        <div className="col-2 m-2">
                            {e.name}
                        </div>
                        <div className="col-1 m-2">
                            {e.price}
                        </div>
                    </div>
                </div>
            )}
        </>
    );
};

export default Cart;
